import React from 'react'
import UserCard from '../layout/UserCard'
import { stars } from '../../DB/previousPosts'

const Tweets = () => {
  return (
    <div className='project-list section'>
      {stars.map((star, i) =>
        (<div>
          <UserCard name={stars[i].name} review={stars[i].review} message={stars[i].message} />
          <br />
        </div>))}

    </div>
  )
}
export default Tweets
